B = intersectionpoint(interp(A,F,0.1)--interp(A,F,5),ell);
P = (2,0);

draw(ell);
draw(A--B);
draw(A--P--B);
draw(F--P);

dot("A", A, N);
dot("B", B, SE);
dot("F", F, SW);
dot("P", P, E);
[/asy]

Question:
There exists a constant $c,$ so that among all chords $\overline{AB}$ of the parabola $y = x^2$ passing through $C = (0,c),$
\[t = \frac{1}{AC} + \frac{1}{BC}\]is a fixed constant.  Find the constant $t.$

[asy]
unitsize(1 cm);

real parab (real x) {
  return(x^2);
}

pair A, B, C;

A = (1.7,parab(1.7));
B = (-1,parab(-1));
C = extension(A,B,(0,0),(0,1));

draw(graph(parab,-2,2));
draw(A--B);
draw((0,0)--(0,4));

dot("$A$", A, E);
dot("$B$", B, SW);
dot("$(0,c)$", C, NW);
[/asy]

