label("$B$",(0,20),NW);
label("$C$",(20,20),NE);
label("$D$",(20,0),SE);
label("I",(2,19),S);
label("II",(9,13),S);
label("III",(11,7),N);
label("IV",(18,1),N);
[/asy]

