pair A, B, C, D, E, F, G, H, I, w, x, y, z;
A=(0,0);
B=(.25,.75);
C=(.5,1.5);
D=(.75,2.25);
E=(1,3);
F=(1.25,2.25);
G=(1.5,1.5);
H=(1.75,.75);
I=(2,0);
w=(A+I)/2;
x=(B+H)/2;
y=(C+G)/2;
z=(D+F)/2;
draw(ellipse(w, 1, .25));
draw(ellipse(x, .75, .1875));
draw(ellipse(y, .5, .125));
draw(ellipse(z, .25, .0625));
draw(A--E--I);
[/asy]

