Question:
In the diagram, $ABCD$ and $EFGD$ are squares each of area 16.  If $H$ is the midpoint of both $BC$ and $EF$, find the total area of polygon $ABHFGD$.

[asy]
unitsize(3 cm);

pair A, B, C, D, E, F, G, H;

F = (0,0);
G = (1,0);
D = (1,1);
E = (0,1);
H = (E + F)/2;
A = reflect(D,H)*(G);
B = reflect(D,H)*(F);
C = reflect(D,H)*(E);

